import './categories.css'

import React, { Component } from 'react'

export class Categories extends Component {
    constructor(props) {
        super(props)
        this.state = {
            categories: [
                {
                    key: 'all',
                    name: 'Всё'
                },
                {
                    key: 'Акустические гитары',
                    name: 'Акустические гитары'
                },
                {
                    key: 'Электрогитары',
                    name: 'Электрогитары'
                },
                {
                    key: 'Классические гитары',
                    name: 'Классические гитары'
                },
                {
                    key: 'Усилители для гитар',
                    name: 'Усилители для гитар'
                },
                {
                    key: 'Цифровое пианино',
                    name: 'Цифровое пианино'
                },
                {
                    key: 'Барабаны',
                    name: 'Барабаны'
                },
            ]
        }
    }
    render() {
        return (
        <>
       
      
        <div className="container">
      
            <div className="categories">
                   
                <div className="classes">
                <div className="container">
      
      <div className="categories">
     
      <div className="classes">
  
      <button><img src="img/pic/AcGuitars.svg" alt="AcGuitars" /></button>
      <button><img src="img/pic/ElectroGuitars.svg" alt="ElectroGuitars" /></button>
      <button><img src="img/pic/AcSys.svg" alt="AcSys" /></button>
      <button><img src="img/pic/Powers.svg" alt="Powers" /></button>
      <button><img src="img/pic/ElPiano.svg" alt="ElPiano" /></button>
      <button><img src="img/pic/Drums.svg" alt="Drums" /></button>
      
      </div>
      </div>  

  </div>
            
            
                </div>
            </div>  

        </div>
      
            </>
        )
    }
}

export default Categories;
